const projectTable = [
    {
        title: 'Job #',
        dataIndex: 'job_number',
        render: (text) => <a>{text}</a>,
    },
    {
        title: 'Project name',
        dataIndex: 'project_name',
    },
    {
        title: 'Created by',
        dataIndex: 'created_by',
    },
    {
        title: 'Created date',
        dataIndex: 'created_at_date',
    },
    {
        title: 'Created time',
        dataIndex: 'created_time',
    },
];

const wellInfoFormTable = [
    {
        title: 'Well name',
        dataIndex: 'well_name',
        align: 'center',
        readOnly
    },
    {
        title: 'Well API',
        dataIndex: 'well_api',
        align: 'center'
    },
    {
        title: 'Formation',
        dataIndex: 'formation',
        align: 'center'
    },
    {
        title: 'Lat',
        dataIndex: 'lat',
        align: 'center'
    },
    {
        title: 'Easting',
        dataIndex: 'easting',
        align: 'center'
    },
    {
        title: 'Northing',
        dataIndex: 'northing',
        align: 'center'
    },
];

const wellInfoFormTableData = {
    columns: [
        { label: "Well name", width: "15%" },
        { label: "Well API", width: "17%" },
        { label: "Formation", width: "17%" },
        { label: "Lat", width: "17%" },
        { label: "Easting", width: "17%" },
        { label: "Northing", width: "17%" },
    ],
    grid: [
        {
          title: "Well 1",
          descriptions: [
            "$ Allowance for Loan Losses"
          ]
        }
    ]
}
const TableHeadersUtil = {
    projectTable,
    wellInfoFormTable,
    wellInfoFormTableData
}

export default TableHeadersUtil;
